import { BrowserRouter as Router } from "react-router-dom";
import Route from "react-router-dom/Route";
import React from "react";
import Home from "../screen/homeScreen/component/HomePage";
import SignInSide from "/Users/rishabhjain/Desktop/covid/src/screen/adminPage/component/Loginadmin.js";
import Signup from "../screen/registeration/component/Signup";
import Login from "/Users/rishabhjain/Desktop/covid/src/screen/authentication/component/Login.js";
import Cardgrid from "../shared/cardDetails/component/CardsGrid";
import Location from "../screen/adminPage/container/Logic";
import Contact from "../screen/homeScreen/component/Contact";
import Navbar from "/Users/rishabhjain/Desktop/covid/src/screen/homeScreen/component/Navbar.js";
import Profile from "/Users/rishabhjain/Desktop/covid/src/screen/myProfile/ProfilePage.js";
import Cardpage from "../shared/cardDetails/containor/CardPage";
const Routers = () => {
  return (
    <Router>
      <div>
        <Route
          path="/"
          exact
          render={() => {
            return (
              <div>
                {/* <Homecontent /> */}
                <Home />
              </div>
            );
          }}
        />
        <Route
          path="/contact"
          exact
          render={() => {
            return (
              <div>
                <Navbar />
                <Contact />
              </div>
            );
          }}
        />
        <Route
          path="/login"
          exact
          render={() => {
            return (
              <div>
                <Navbar />
                <Login />
              </div>
            );
          }}
        />
        <Route
          path="/signup"
          exact
          render={() => {
            return (
              <div>
                <Navbar value={false} />
                <Signup />
              </div>
            );
          }}
        />
        <Route
          path="/loginpage"
          exact
          render={() => {
            return (
              <div>
                <Location />
                <SignInSide />
                <Cardpage />
                <Cardgrid />
              </div>
            );
          }}
        />
        <Route
          path="/profile"
          exact
          render={() => {
            return (
              <div>
                <Navbar value={false} />
                <Profile />
              </div>
            );
          }}
        />
      </div>
    </Router>
  );
};

export default Routers;
